import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const SidebarLink = styled(Link)`
  display: flex;
  color: #e1e9fc;
  justify-content: space-between;
  align-items: center;
  list-style: none;
  text-decoration: none;
  font-size: 16px;
  margin-left: 0%;
  margin-top: 0.5ch;
  margin-bottom: 1ch;
  margin-right: 1ch;
  height:35px;


  &:hover {
    background: #252831;
    border-left: 4px solid green;
    cursor: pointer;
  }
`;

const SidebarLabel = styled.span`
`;

const DropdownLink = styled(Link)`
  background: #252831;
  padding-left: 3rem;
  display: flex;
  align-items: center;
  text-decoration: none;
  color: rgb(160, 161, 179);
  font-size: 15px;
  height:35px;
  margin-top:0%;

  &:hover {
    background: #252831;
    cursor: pointer;
    color:#fff;
  }
`;

const SubMenu = ({item}) => {
    console.log("sdsdfds");

  const [subnav, setSubnav] = useState(false);
  const [subnav1,setsubnav1]=useState(false);
  const showSubnav = () => setSubnav(!subnav);
  return (
    <>
      <SidebarLink to={item.path} 
        onClick={item.subNav && showSubnav}>
        <div>
          {item.icon}
          <SidebarLabel>{item.title}</SidebarLabel>
        </div>
        <div>
          {
            item.subNav && subnav
            ? item.iconOpened
            : item.subNav
            ? item.iconClosed
            : null
          }
        </div>
      </SidebarLink>
      {subnav &&
        item.subNav.map((item1, index1) => {
          if(index1==0)
          {
            return (
              <>
              <DropdownLink to={item1.path} key={index1}>
                <div>
                  {item1.icon}
                  <SidebarLabel>{item1.title}</SidebarLabel>
                </div>
                <div>
                  {
                    item1.subNav && subnav1
                    ? item1.iconOpened
                    : item1.subNav
                    ? item1.iconClosed
                    : null
                  }
                </div>
              </DropdownLink>
              {subnav1 &&
                item1.subNav.map((item2, index2) => 
                {
                  if(index2==0){
                    return (
                      <>
                      <DropdownLink to={item2.path} key={index2}>
                        <div>
                          {item2.icon}
                          <SidebarLabel>{item2.title}</SidebarLabel>
                        </div>
                        <div>
                          {
                            item2.subNav && subnav
                            ? item2.iconOpened
                            : item2.subNav
                            ? item2.iconClosed
                            : null
                          }
                        </div>
                      </DropdownLink>
                      </>
                    );}
                  else
                  {
                    return(
                      <DropdownLink to={item1.path} key={index1}>
                        {item1.icon}
                        <SidebarLabel>{item1.title}</SidebarLabel>
                      </DropdownLink>
                    );
                  }
                })
              }
              </>
            );
          }
          else
          {
            return(
                <DropdownLink to={item1.path} key={index1}>
                  {item.icon}
                  <SidebarLabel>{item1.title}</SidebarLabel>
                  </DropdownLink>
            );
        }
        })
      }
    </>
  );
};

export default SubMenu;
